import React, { Component } from "react";
import "./heroImg2.css"

class HeroImg2 extends Component {
    render(){
        return (
            <div className="hero-Img">
            <div className="heading">
                <h1>
                    {this.props.heading}
                </h1>
                <p>
                    {this.props.text}
                </p>
            </div>
        </div>
        );
    }
};

export default HeroImg2;
